    private void doErpSetCompanyID(Integer pCompanyTypeId,BigDecimal pCompanyCode,Integer pTypeLevel) {
        //System.out.println(pCompanyTypeId+ "pCompanyTypeId");
        //System.out.println(pCompanyCode+ "pCompanyCode");
        //System.out.println(gettxtDefinedCompanyTypeSno()+ "gettxtDefinedCompanyTypeSno");
        //System.out.println( (pCompanyTypeId!=null)+ "pCompanyTypeId!=null");
        //System.out.println( (pCompanyTypeId.equals(gettxtDefinedCompanyTypeSno()) )+ "pCompanyTypeId==gettxtDefinedCompanyTypeSno()");
        if (pCompanyTypeId!=null && pCompanyTypeId.equals(gettxtDefinedCompanyTypeSno()) ) {
        //System.out.println(gettxtDefinedCompanyTypeSno()+ "gettxtDefinedCompanyTypeSno-to");
         settxtCompanyID(pCompanyCode);
         settxtCompanyTypeId(gettxtDefinedCompanyTypeSno());
         settxtTypeLevel(pTypeLevel);
        }
    }
        //this procedure will unser the company type id
    /// because company type is dependent on levels
    //in case we unset top level company
    //then if company level is less than top level then company type should be null
    private void doErpUnSetCompanyID(Integer pNewCompanyTypeId,Integer pOldCompanyTypeId,Integer pTypeLevel) {
        if ( ( gettxtTypeLevel()!=null &&  pTypeLevel.compareTo(gettxtTypeLevel()) <=0 )  ||( pNewCompanyTypeId==null && pOldCompanyTypeId.equals(gettxtDefinedCompanyTypeSno()) ) ) {
         settxtCompanyID(null);   
         settxtCompanyName(null);   
         settxtTypeLevel(null);
         settxtCompanyTypeId(null);
         settxtFiscalYearSno(null);
         settxtFiscalYearName(null);
         settxtPeriodName(null);
         settxtPeriodID(null);
         
        }
    }

    public void doErpSetGlobalHierarchyPath(Integer pLevel) {
        String[] erpColumnName = {
            "txtLevelOneCompanyID", "txtLevelTwoCompanyID", "txtLevelThreeCompanyID", "txtLevelFourCompanyID",
            "txtLevelFiveCompanyID", "txtLevelSixCompanyID", "txtLevelSevenCompanyID", "txtLevelEightCompanyID",
            "txtLevelNineCompanyID", "txtLevelTenCompanyID", "txtLocationId"
        };
        String Erpvalue = "";
        for (int i = 0; i < pLevel; i++) {
            if (i == 0) {
                Erpvalue = "" + getAttribute(erpColumnName[i]);
            } else {
                Erpvalue = Erpvalue + "-" + getAttribute(erpColumnName[i]);
            }
        }
        
        if (gettxtLocationId()!=null) {
           Erpvalue = Erpvalue + "-" + gettxtLocationId();
       }
        
        settxtGlobalHierarchyPath(Erpvalue);
    }
   
